import React from 'react'

function Search() {
	function actv(e){
		let btns = document.querySelectorAll(".Search button")
		btns.forEach(btn => {
			btn.classList.remove("actv")
		})
		e.target.classList.add("actv")
	}
	return (
		<div className='Search'>
			<input type="text" placeholder='Kinolarni qidirish' />
			<button onClick={actv}>Barcha kinolar</button>
			<button onClick={actv}>Mashhur kinolar</button>
			<button onClick={actv}>Eng ko'p ko'rilgan kinolar</button>
		</div>
	)
}

export default Search
